import { Component } from '@angular/core';
import { HttpClient } from '@angular/common/http';


@Component({
  selector: 'app-registerusuario',
  templateUrl: './regsterusuario/registerusuario.component.html',
  styleUrls: ['./regsterusuario/registerusuario.component.css']
})
export class RegisterusuarioComponent {
  form: any = {}; // Objeto para almacenar los datos del formulario

  constructor(private http: HttpClient) { }

  registerUser() {
    this.http.post('http://localhost:3000/usuarios/', this.form)
      .subscribe(
        response => {
          console.log('Usuario registrado exitosamente', response);
          // Realiza cualquier acci贸n adicional que desees, como mostrar una notificaci贸n o redirigir al usuario.
        },
        error => {
          console.error('Error al registrar el usuario', error);
          // Maneja cualquier error que pueda ocurrir, como mostrar un mensaje de error al usuario.
        }
      );
  }
}
